import {useState , useEffect} from 'react'
import axios from 'axios'

function PaysAPI() {
  const [pays , setPays] = useState([])
  useEffect(()=>{
    const getPays = async()=>{
      const res = await axios.get('/api/pays')
      setPays(res.data)
    }
    getPays()
  },[])
  return {
    Pays :[pays , setPays]
  }
}

export default PaysAPI
